import React from 'react';
import ComponentLearnLayout from '../../../../layouts/componentLearnLayout/ComponentLearnLayout';
import Header from '../../../../../commonComponents/header/Header';

/**
 * Description - This Function display the fans information
 * @returns - fans information
 */
function infoFANS() {
  return (
    <ComponentLearnLayout name='fans'>
      <Header h1Heading='Fans Information' />
      <p>
        A fan is a hardware device that keeps the overall computer or a computer
        device cool by circulating air to or from the computer or component.
      </p>

      <p>
        The speed of a fan is measured in revolutions per minute or RPM, and the
        higher the RPM rating, the faster the fan spins. However, in many cases,
        the higher the RPM rating, the louder a fan.
      </p>
    </ComponentLearnLayout>
  );
}

export default infoFANS;
